You may someday be able to spend much less time in an imaging machine. Just let AI make the picture.

That initiative is part of an ongoing effort at the medical center, in partnership with Facebook Artificial Intelligence Research, to see if running an MRI machine faster‚Äîand grabbing less data in the process‚Äîcan produce images that are just as good those that arise the normal way. Reducing an approximately 10-minute knee scan to about 5 minutes, or shortening the scan time for other body areas, has obvious benefits: A patient could spend less time in a clanging tube (a procedure that demands they hold as still as possible) and hospitals could do more with the expensive, limited hardware they have.

To make this possible, radiologists and computer scientists need to employ artificial intelligence. If they were to run an MRI machine twice as fast as usual and then try to spin the data they collected into an image with the normal method, the result would be unusably bad. Enter AI: Using machine learning to analyze that comparably scant data and then create a picture produces something that is indeed usable, and in fact, looks to be of nicer quality to some radiologists‚Äô eyes than the alternative.

